import React, {useState} from 'react';
import { Link, useHistory } from 'react-router-dom';
import axios from "axios";

const Header = () => {
    const history = useHistory();
    const [sessionId, setSessionId] = useState(window.sessionStorage.getItem("id"));
    const logoutRequest = async () => {
        try {
            await axios.get('/auth/logout');
            window.sessionStorage.clear();
            setSessionId(null);
            history.push("/login");
        }
        catch (e) {
            alert(e);
        }
    }
    return (
        <div className="header">
            <nav className="navbar navbar-dark bg-dark">
                <div className="container-fluid">
                    <h2 className="navbar-brand">RacerIn</h2>
                    {
                        sessionId && (
                        <div className="collapse navbar-collapse" id="navbarNav">
                            <ul className="navbar-nav">
                                <li className="nav-item">
                                    <Link to="/main" className="nav-link">메인</Link>
                                </li>
                                <li className="nav-item">
                                    <Link to="/network" className="nav-link">네트워크</Link>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link" onClick={logoutRequest}>로그아웃</a>
                                </li>
                            </ul>
                        </div>
                    )}
                </div>
            </nav>
        </div>
    )

}

export default Header
